class Solution {

    /**
     * @param String $num
     * @return Integer
     */
    function minimumOperations($num) {
        $result = PHP_INT_MAX;
        $length = strlen($num);

        // Check for all combinations to form 00, 25, 50, 75 at the end
        $combinations = ['00', '25', '50', '75'];
        foreach ($combinations as $combination) {
            $lastIndex = $length;
            $ops = 0;
            for ($i = 1; $i >= 0; $i--) {
                $pos = strrpos($num, $combination[$i], $i - $length);
                if ($pos === false) {
                    $ops = PHP_INT_MAX;
                    break;
                } else {
                    $ops += $lastIndex - $pos - 1;
                    $lastIndex = $pos;
                }
            }
            $result = min($result, $ops);
        }

        return $result == PHP_INT_MAX ? -1 : $result;
    }
}
